import React, {useContext} from 'react';
import {RenderPublishedContext} from "./context/renderPublishedContext";
import {useNavigate} from "react-router-dom";

const RenderPublished = () => {
	const publishedSurveys = useContext(RenderPublishedContext);
	const navigate = useNavigate();

	/* 查看详情 */
	async function handleCheck(e){
		e.preventDefault();
	}


	/* 结束收集 */
	async function handleEndCollection(e){
		e.preventDefault();
	}


	// 已发布组件生成
	const elements = publishedSurveys.map(survey => {
		return (
			<fieldset key={survey.id}>
				<fieldset id={survey.id}>
					<h1>{survey.title}</h1>
					<h2>{survey.description}</h2>
					<h4>{survey.endCollection ? '已结束收集' : '收集中'}</h4>
				</fieldset>
				<div>
					<button onClick={handleCheck}>{'查看详情'}</button>
					<button onClick={handleEndCollection}>{'结束收集'}</button>
				</div>
			</fieldset>
		)
	});


	return (
		<div>
			{'已发布的问卷'}
			{elements}
		</div>
	);
};

export default RenderPublished;
